window.bookSummaryJSON = "<p><b>The most powerful starships ever constructed are taken. Thousands are dead. A fleet is in ruins....</b><br> &nbsp;</p> <p>Lieutenant Abigail Cage never expected to find herself in hell. There was a time when she was one of the most respected operatives in the military. Now, she's doing hard labor on the most miserable planet in the universe.<br> &nbsp;</p> <p>Not for long.<br> &nbsp;</p> <p>The Republic is looking for the most dangerous individuals it can control. The best of the worst, and Abbey is one of them. Joined by the most ragtag collection of criminals the galaxy has to offer, she sets out to recover the ships and take down the traitors who stole them.<br> &nbsp;</p> <p>There's only one problem....<br> &nbsp;</p> <p>A new evil is rising in the galaxy. One with a power unlike anything anyone has ever seen. One that's been waiting for this moment for a very, very long time.<br> &nbsp;</p> <p>And it wants Abbey too.<br> &nbsp;</p> <p>If you love Captain Marvel, Guardians of the Galaxy, or Star Wars, youâ€™ll love riding along with the Rejects in this fun-filled, action-packed space opera adventure from million-selling author M.R. Forbes.</p>"; 
